import React from 'react';

class Login extends React.Component{
	constructor(){
		super();
		this.state = {
			isLoggedIn: true,
			in: "in",
			out: "out"
		};
	}

	render(){
		return(
			<div>
				<h1>You are currently logged {this.state.isLoggedIn ?
						this.state.in : this.state.out}</h1>
			</div>
			);
	}
}

export default Login;
